import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <div id="header">
        <div>Contact</div>
        <div id="shelby">SHELBY</div>
        <div id='navRight'>
          <div>About</div>
          <div>Portfolio</div>
        </div>
      </div>
    )
  }
}

export default Header
